import React,{Component} from 'react';


class TrainDetails extends Component
{
    render() {
        return(
            <div style={leftStyle}>
                <h3 style={{textAlign:'center'}}>Train details</h3>
                <table style={tableStyle}>
                    <tbody>
                       <tr style={cellStyle}>
                           <td>
                               <b><label>Starting Point</label></b>
                           </td>
                           <td>

                           </td>
                       </tr>
                       <tr style={cellStyle}>
                           <td>
                               <b><label>Destination Point</label></b>
                           </td>
                           <td>

                           </td>
                       </tr>
                       <tr style={cellStyle}>
                           <td>
                               <b><label>Date</label></b>
                           </td>
                           <td>

                           </td>
                       </tr>
                       <tr style={cellStyle}>
                           <td>
                               <b><label>Number of tickets</label></b>
                           </td>
                           <td>

                           </td>
                       </tr>
                    </tbody>
                </table>
            </div>

        );
    }
}

const leftStyle={
    position:'absolute',
    background:'LightGrey',
    width:'700px',
    height:'500px',
    textAlign:'left',
    border: '3px solid Black'
};
const cellStyle={
    height:'50px'
};

const tableStyle={
    width:"500px",
    marginLeft:'15%',
    marginRight:'15%'
};
export default TrainDetails;
